package de.robotricker.transportpipes.items;

import org.bukkit.inventory.ItemStack;

import javax.inject.Inject;

import de.robotricker.transportpipes.duct.DuctRegister;
import de.robotricker.transportpipes.duct.pipe.Pipe;
import de.robotricker.transportpipes.duct.types.BaseDuctType;
import de.robotricker.transportpipes.duct.types.pipetype.PipeType;

public class PipeItemManager extends ItemManager<Pipe> {

    private ItemService itemService;
    private DuctRegister ductRegister;

    @Inject
    public PipeItemManager(ItemService itemService, DuctRegister ductRegister) {
        super();
        this.itemService = itemService;
        this.ductRegister = ductRegister;
    }

    @Override
    public void registerItems() {
        ItemStack item;
        PipeType pipeType;
        BaseDuctType<Pipe> pipeBaseDuctType = ductRegister.baseDuctTypeOf("pipe");

        pipeType = pipeBaseDuctType.ductTypeOf("White");
        item = itemService.createHeadItem("9f38586a-2ec7-33be-a472-13939b855430", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Blue");
        item = itemService.createHeadItem("b3ee4986-c3ad-3199-9536-13cffe591185", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Red");
        item = itemService.createHeadItem("058a6092-456a-32c9-8e9d-5fcadf620631", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Yellow");
        item = itemService.createHeadItem("9bdb3363-b7e5-35ea-9fc6-02b2608ced3e", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Green");
        item = itemService.createHeadItem("7b0b532f-d8cd-3024-bdcc-9afb25c8d790", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Black");
        item = itemService.createHeadItem("7366ff1c-7c05-3c06-a582-71f15641178d", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Golden");
        item = itemService.createHeadItem("a4ad8e9d-bff3-3549-932d-f92ab895badd", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Iron");
        item = itemService.createHeadItem("3874f281-eefe-3e26-94ab-d32a53cf3359", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Ice");
        item = itemService.createHeadItem("f5fb2bb0-b743-3401-9508-141689682ed6", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Void");
        item = itemService.createHeadItem("b9871e6c-f129-3364-ad40-b41177032a91", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Extraction");
        item = itemService.createHeadItem("e8501df6-3418-3470-afe3-723dd4a48186", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
        pipeType = pipeBaseDuctType.ductTypeOf("Crafting");
        item = itemService.createHeadItem("2589f15a-2e13-4af3-b21c-3b1df42c98d0", "", "");
        item = itemService.changeDisplayName(itemService.setDuctNBTTags(pipeType, item), pipeType.getFormattedTypeName());
        items.put(pipeType, item);
    }

}
